function App() {
  const meals = localStorage.getItem(L)

  return (
    <BrowserRouter>
      <Nav />
      <div className='App'>
        <Routes>
          <Route path='/' element={<Home />}></Route>
          <Route path='/meal' element={<MealPage meals={meals}/>}></Route>
        </Routes>
      </div>
    </BrowserRouter>
  );
}

export default App;
